import styles from './Navigation.module.css'
import {Card, Row, Container} from 'react-bootstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Cart = () => {
    return(
        <Card>
            <Container>
            <Row>
                <img src="https://media.istockphoto.com/vectors/shopping-cart-icon-isolated-on-white-background-vector-id1206806317?s=612x612" alt="Italian Trulli" style={{width:"50px", height:"50px"}}/>
                <div className={styles.cart}>Your Cart</div>
            </Row>
            </Container>
        </Card>
    )
}

export default Cart;
